import Card from "../Card/Card";
import "./Cards.css";

function Cards(){
    const lista = [
        
    ];


    return (
        <div className="Cards">
      
            {lista.map(function(item, i){
                return (
                    <div className="CardsContainer">
                        <Card titulo={item.titulo} subtitulo={item.subtitulo} preco={item.preco}/>
                    </div>
                )
            })}
        </div>
    );
}

export default Cards;
